import React from 'react';
import { Grid, Typography } from '@material-ui/core';

const Stats = (props) => {
    return (
        <Container>
        <Grid item container className="gameStats" alignItems="stretch" style={{height: window.innerHeight/6}}>
              <Grid item xs={6}><Typography variant="h1">Puppy Memory Game</Typography></Grid>
              <Grid item xs={3}>{props.timer}<Typography> Seconds</Typography></Grid>
              <Grid item xs={3}>{props.moves}<Typography> Moves</Typography></Grid>
        </Grid>
        </Container>
    );
};

export default Stats;
